function Food({fav}) {
  console.log(fav);
  return <h1>I love {fav}</h1>;
}

function App() {
  return (
    <div>
      <h1>Hello</h1>
      <Food fav="김치" />
      <Food fav="라면" />
      <Food fav="피자" />
      <Food fav="초밥" />
    </div>
  );

}

export default App;
